sys_variable_value.value:
(function execute(inputs, outputs) {
  var util = new JSONBuilder();
  var temp = {};
 // var tempArray = [];

  //1
  var temparr={};
  var temp1 = util.addObjectElement(temp,"Location", inputs.location);
  temparr = util.createObjectElement("hardwareProfile",util.createObjectElement("vmSize",inputs.HardwareProfile)));
  temp1 = util.addObjectElement(temp,"Properties", temparr);

  outputs.temp={"properties" : temp1}
})(inputs, outputs);

