sys_variable_value.value:
(function execute(inputs, outputs) {
  for(var key in inputs){
    if(!inputs[key]){
      throw new Error("Mandatory inputs cannot be empty");
    }
  }

 gs.info('Properties=>'+inputs.properties);
})(inputs, outputs);

